import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

contract USDT is
    Initializable,
    ERC20Upgradeable,
    ERC20BurnableUpgradeable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    function initialize() public initializer {
        __ERC20_init("Tether", "USDT");
        __ERC20Burnable_init();
        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();

        _mint(msg.sender, 99999999 * 10 ** decimals());
    }

    function decimals() public pure override returns (uint8) {
        return 6;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override whenNotPaused {
        super._beforeTokenTransfer(from, to, amount);
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}
}

contracts/StakingV1Upgradable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint);
}

interface IReferral {
    function payStakingReferralAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);
}

contract StakingV1Upgradable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    address private tokenContract;
    address private presaleContract;
    address private referralContract;

    uint256 private totalStakers;
    uint256 private totalValueStaked;
    uint256 private totalRewardsDistributed;

    uint256[] private stakingDurations;
    uint256[] private rewardRates;

    uint256 private minStakingValue;
    uint256 private minStakingDuration;
    uint256 private maxStakingDuration;

    struct Account {
        uint256 valueStaked;
        uint256 rewardRate;
        uint256 startTime;
        uint256 endTime;
        uint256 rewardClaimed;
    }

    mapping(address => mapping(uint256 => Account)) private user;
    mapping(address => uint256[]) private userStakingIndexes;
    mapping(address => uint256[]) private userRewardClaimed;
    mapping(address => uint256[]) private userRewardClaimedTimestamp;

    event Stake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed duration,
        uint256 stakingID
    );
    event StakingRewardClaimed(
        address indexed userAddress,
        uint256 indexed reward,
        uint256 indexed stakingID
    );
    event Unstake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed stakingID
    );

    function initialize() public initializer {
        tokenContract = 0xaDA2dEc22F0796F9B4A538f51b6AC868D449c143;
        presaleContract = 0x4335b21A5405401181B91A537135Ff880d572A63;
        referralContract = 0x757e2C2F74dF91b9A465B730316bC16B2f3295f4;

        stakingDurations = [90 days, 180 days, 365 days, 545 days];
        rewardRates = [12, 30, 18, 21];
        minStakingValue = 100000000000000000000;
        maxStakingDuration = 545 days;
        minStakingDuration = 30 days;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function _getRewardRate(
        uint256 _duration
    ) private view returns (uint256 currentReward) {
        uint256 userStakingDuration = _duration;
        uint256 stakingDurationsLength = stakingDurations.length;

        for (uint8 i; i < stakingDurationsLength; i++) {
            if (userStakingDuration <= stakingDurations[i]) {
                currentReward = rewardRates[i];
                break;
            } else if (i == stakingDurationsLength - 1) {
                currentReward = rewardRates[i];
            }
        }

        return currentReward;
    }

    function _stake(
        address _address,
        uint256 _value,
        uint256 _duration
    ) private returns (bool) {
        require(
            _duration <= maxStakingDuration && _duration >= minStakingDuration,
            "Staking duration must be >= minStakingDuration and <= maxStakingDuration."
        );
        require(
            _value >= minStakingValue,
            "Staking value should be >= minStakingValue."
        );
        uint256 stakingID = totalStakers + 1;
        Account storage userAccount = user[_address][stakingID];

        userAccount.valueStaked = _value;
        userAccount.rewardRate = _getRewardRate(_duration);
        userAccount.startTime = _getCurrentTime();
        userAccount.endTime = _getCurrentTime() + _duration;
        userStakingIndexes[_address].push(uint8(stakingID));

        totalStakers++;
        totalValueStaked += _value;

        emit Stake(_address, _value, _duration, stakingID);

        return true;
    }

    function stake(
        uint256 _value,
        uint256 _duration
    ) external whenNotPaused returns (bool) {
        IERC20Upgradeable(tokenContract).transferFrom(
            msg.sender,
            address(this),
            _value
        );
        return _stake(msg.sender, _value, _duration);
    }

    function stakeByAdmin(
        address _userAddress,
        uint256 _value,
        uint256 _duration
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() ||
                _msgSender == presaleContract ||
                _msgSender == referralContract,
            "Only owner can call this function."
        );
        return _stake(_userAddress, _value, _duration);
    }

    function _getStakingReward(
        address _address,
        uint256 _stakingID
    ) private view returns (uint256 stakingReward) {
        Account storage userAccount = user[_address][_stakingID];
        uint256 valueStaked = userAccount.valueStaked;
        uint256 startTime = userAccount.startTime;
        uint256 endTime = userAccount.endTime;

        uint256 baseReward = ((valueStaked * userAccount.rewardRate) / 100) /
            30 days;
        uint256 stakingTimePassed = _getCurrentTime() - startTime;
        stakingReward =
            (baseReward *
                _min(_min(endTime, stakingTimePassed), maxStakingDuration)) -
            userAccount.rewardClaimed;

        return stakingReward;
    }

    function getStakingReward(
        address _userAddress,
        uint256 _stakingID
    ) external view returns (uint256) {
        return _getStakingReward(_userAddress, _stakingID);
    }

    function _claimReward(
        address _address,
        uint256 _stakingID
    ) private returns (uint256) {
        Account storage userAccount = user[_address][_stakingID];
        require(userAccount.valueStaked > 0, "You have no staking yet.");
        uint256 stakingReward = _getStakingReward(_address, _stakingID);
        userAccount.rewardClaimed += stakingReward;
        userRewardClaimed[_address].push(stakingReward);
        userRewardClaimedTimestamp[_address].push(_getCurrentTime());
        totalRewardsDistributed += stakingReward;
        emit StakingRewardClaimed(_address, stakingReward, _stakingID);
        IReferral(referralContract).payStakingReferralAdmin(
            stakingReward,
            _address
        );

        return stakingReward;
    }

    function claimStakingReward(uint256 _stakingID) external returns (bool) {
        uint256 stakingReward = _claimReward(msg.sender, _stakingID);
        IERC20Upgradeable(tokenContract).transfer(msg.sender, stakingReward);
        return true;
    }

    function _unStake(
        address _address,
        uint256 _stakingID
    ) private returns (uint256) {
        Account storage userAccount = user[_address][_stakingID];
        uint256 valueStaked = userAccount.valueStaked;
        require(
            valueStaked > 0 && _getCurrentTime() >= userAccount.endTime,
            "Your staking is not over or you have no staking yet."
        );

        delete userAccount.valueStaked;
        delete userAccount.rewardRate;
        delete userAccount.startTime;
        delete userAccount.endTime;

        totalValueStaked -= valueStaked;
        totalStakers--;

        emit Unstake(_address, valueStaked, _stakingID);
        return valueStaked;
    }

    function unStake(uint256 _stakingID) external returns (bool) {
        uint256 stakingReward = _claimReward(msg.sender, _stakingID);
        uint256 unStakeValue = _unStake(msg.sender, _stakingID);
        IERC20Upgradeable(tokenContract).transfer(
            msg.sender,
            stakingReward + unStakeValue
        );
        return true;
    }

    function unStakeByAdmin(
        address _userAddress,
        uint256 _stakingID
    ) external onlyOwner returns (bool) {
        _claimReward(_userAddress, _stakingID);
        _unStake(_userAddress, _stakingID);
        return true;
    }

    function isStaked(address _userAddress) external view returns (bool) {
        uint256[] memory stakingIndexes = userStakingIndexes[_userAddress];
        uint256 stakingIndexsLength = stakingIndexes.length;

        for (uint256 i; i < stakingIndexsLength; i++) {
            if (user[_userAddress][stakingIndexes[i]].valueStaked > 0) {
                return true;
            }
        }

        return false;
    }

    function getUserTotalStakedValue(
        address _userAddress
    ) external view returns (uint256 userTotalValueStaked) {
        uint256[] memory stakingIndexes = userStakingIndexes[_userAddress];
        uint256 stakingIndexesLength = stakingIndexes.length;

        for (uint256 i; i < stakingIndexesLength; i++) {
            userTotalValueStaked += user[_userAddress][stakingIndexes[i]]
                .valueStaked;
        }
    }

    function getUserStakingByID(
        address _address,
        uint256 _stakingID
    )
        external
        view
        returns (
            uint256 valueStaked,
            uint256 startTime,
            uint256 endTime,
            uint256 stakingDuration,
            uint256 timeLeft
        )
    {
        Account storage userAccount = user[_address][_stakingID];
        valueStaked = userAccount.valueStaked;
        startTime = userAccount.startTime;
        endTime = userAccount.endTime;
        stakingDuration = endTime - startTime;
        if (_getCurrentTime() >= endTime) {
            timeLeft = 0;
        } else {
            timeLeft = endTime - _getCurrentTime();
        }
    }

    function getUserStakingRewardRate(
        address _userAddress,
        uint256 _stakingID
    ) external view returns (uint256) {
        Account storage userAccount = user[_userAddress][_stakingID];
        return userAccount.rewardRate;
    }

    function getUserStakingAPY(
        address _userAddress,
        uint256 _stakingID
    ) external view returns (uint256 userStakingAPY) {
        Account storage userAccount = user[_userAddress][_stakingID];
        uint256 userCurrentRewardRate = userAccount.rewardRate;
        userStakingAPY = userCurrentRewardRate * 12;
        return userStakingAPY;
    }

    function getUserTotalStakingsCount(
        address _userAddress
    ) external view returns (uint256) {
        return userStakingIndexes[_userAddress].length;
    }

    function getUserStakingIDs(
        address _userAddress
    ) external view returns (uint256[] memory) {
        return userStakingIndexes[_userAddress];
    }

    function getUserRewardClaimedByStakingID(
        address _userAddress,
        uint256 _stakingID
    ) external view returns (uint256) {
        Account storage userAccount = user[_userAddress][_stakingID];
        return userAccount.rewardClaimed;
    }

    function getUserTotalRewardClaimed(
        address _userAddress
    )
        external
        view
        returns (
            uint256 totalRewardClaimed,
            uint256[] memory rewardClaimedArray,
            uint256[] memory rewardClaimedTimestamp
        )
    {
        rewardClaimedArray = userRewardClaimed[_userAddress];
        uint256 rewardClaimedlength = rewardClaimedArray.length;

        for (uint256 i; i < rewardClaimedlength; i++) {
            totalRewardClaimed += rewardClaimedArray[i];
        }
        rewardClaimedTimestamp = userRewardClaimedTimestamp[_userAddress];
    }

    function getTokenContract()
        external
        view
        returns (
            address tokenAddress,
            string memory tokenName,
            uint256 tokenDecimals,
            uint256 tokenSupply
        )
    {
        tokenAddress = tokenContract;
        tokenName = IERC20_EXTENDED(tokenContract).name();
        tokenDecimals = IERC20_EXTENDED(tokenContract).decimals();
        tokenSupply = IERC20Upgradeable(tokenContract).totalSupply();
    }

    function setTokenAddress(
        address _tokenAddress
    ) external onlyOwner returns (address) {
        tokenContract = _tokenAddress;
        return tokenContract;
    }

    function getStakingAnalystics()
        external
        view
        returns (
            uint256[] memory stakingRewardRates,
            uint256[] memory stakingRewardDurations,
            uint256 stakers,
            uint256 tokenStaked,
            uint256 rewardDistributed
        )
    {
        stakingRewardRates = rewardRates;
        stakingRewardDurations = stakingDurations;
        stakers = totalStakers;
        tokenStaked = totalValueStaked;
        rewardDistributed = totalRewardsDistributed;
    }

    function setStakingDurationAndRateAdmin(
        uint256[] calldata _rewardRates,
        uint256[] calldata _stakingDurations
    ) external onlyOwner returns (bool) {
        rewardRates = _rewardRates;
        stakingDurations = _stakingDurations;
        return true;
    }

    function getStakingCapping()
        external
        view
        returns (
            uint256 minTokensToStake,
            uint256 minDurationToStake,
            uint256 maxDurationToStake
        )
    {
        minTokensToStake = minStakingValue;
        minDurationToStake = minStakingDuration;
        maxDurationToStake = maxStakingDuration;
    }

    function setMinStakingValue(
        uint256 _value
    ) external onlyOwner returns (uint256) {
        minStakingValue = _value;
        return minStakingValue;
    }

    function setMinStakingDuration(
        uint256 _value
    ) external onlyOwner returns (uint256) {
        minStakingDuration = _value;
        return minStakingDuration;
    }

    function setMaxStakingDuration(
        uint256 _value
    ) external onlyOwner returns (uint256) {
        maxStakingDuration = _value;
        return maxStakingDuration;
    }

    /*Admin function*/

    function withdrawTokens(
        address _tokenAddress,
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        IERC20Upgradeable(_tokenAddress).transfer(_receiver, _value);
        return true;
    }

    function withdrawNativeFunds(
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        payable(_receiver).transfer(_value);
        return true;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function _getCurrentTime() private view returns (uint256 currentTime) {
        currentTime = block.timestamp;
        return currentTime;
    }

    function _min(uint256 a, uint256 b) private pure returns (uint256) {
        return a < b ? a : b;
    }
}

contracts/ReferralV1Upgradable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint);
}

contract ReferralV1Upgradable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    using SafeMathUpgradeable for uint256;

    address private tokenContract;
    address private USDContract;
    address private presaleContract;
    address private stakingContract;

    address private tokenSeller;

    uint256[] private levelRateReferral;
    uint256[] private levelRateStaking;
    uint256 private levelDecimals;
    uint256 private maxLevels;

    uint256 private pendingReferralETH;
    uint256 private pendingReferralUSD;
    uint256 private pendingReferralStaking;

    uint256 private totalReferralPaidETH;
    uint256 private totalReferralPaidUSD;
    uint256 private totalReferralPaidStaking;

    address payable private defaultReferrer;

    struct Account {
        address referrer;
        address[] referredAddresses;
        address[] teamAddress;
        uint256 totalBusinessETH;
        uint256 totalBusinessUSD;
        uint256 pendingRewardETH;
        uint256 pendingRewardUSD;
        uint256 pendingRewardStaking;
        uint256[] rewardPaidETH;
        uint256[] rewardPaidUSD;
        uint256[] rewardPaidStaking;
        uint256[] rewardPaidTimeETH;
        uint256[] rewardPaidTimeUSD;
        uint256[] rewardPaidTimeStaking;
    }

    mapping(address => Account) private accounts;

    event RegisteredReferer(address indexed referrer, address indexed referee);

    event RegisteredTeamAddress(
        address indexed parent,
        address indexed referrer,
        address indexed referee
    );

    event RegisterRefererFailed(
        address indexed referee,
        address indexed referrer,
        string indexed reason
    );

    event ReferralIncomeGenerated(
        address indexed referee,
        address indexed referrer,
        uint256 indexed amount,
        uint256 level,
        string currency
    );

    event StakingReferralIncomeGenerated(
        address indexed referee,
        address indexed referrer,
        uint256 indexed amount,
        uint256 level,
        string currency
    );

    event ReferralRewardClaimed(
        address indexed userAddress,
        uint256 indexed rewardValue,
        string currency
    );

    function initialize() public initializer {
        tokenContract = 0xaDA2dEc22F0796F9B4A538f51b6AC868D449c143;
        USDContract = 0xbfA0e2F4b2676c62885B1033670C71cdefd975fB;
        presaleContract = 0x4335b21A5405401181B91A537135Ff880d572A63;
        stakingContract;

        defaultReferrer = payable(0x4345492B7bf4967e8Ff7b3D0858945560391eab1);
        levelDecimals = 100;
        levelRateReferral = [10];
        levelRateStaking = [10, 5, 3, 2, 1];
        maxLevels = 5;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function getUserAccount(
        address _address
    ) external view returns (Account memory userAccount) {
        userAccount = accounts[_address];
    }

    function getLevelDecimals() external view returns (uint256) {
        return levelDecimals;
    }

    function setLevelDecimals(
        uint256 _value
    ) external onlyOwner returns (bool) {
        levelDecimals = _value;
        return true;
    }

    function getLevelRates()
        external
        view
        returns (
            uint256[] memory presale,
            uint256 totalRatePresale,
            uint256[] memory staking,
            uint256 totalRateStaking
        )
    {
        presale = levelRateReferral;
        uint256 presaleRateLength = presale.length;
        for (uint8 i; i < presaleRateLength; i++) {
            totalRatePresale += presale[i];
        }
        staking = levelRateStaking;
        uint256 stakingRateLength = staking.length;
        for (uint8 i; i < stakingRateLength; i++) {
            totalRateStaking += staking[i];
        }
    }

    function setLevelRateReferral(
        uint256[] calldata _value
    ) external onlyOwner returns (bool) {
        levelRateReferral = _value;
        return true;
    }

    function setLevelRateStaking(
        uint256[] calldata _value
    ) external onlyOwner returns (bool) {
        levelRateStaking = _value;
        return true;
    }

    function getMaxLevels() external view returns (uint256) {
        return maxLevels;
    }

    function setMaxLevels(uint256 _value) external onlyOwner returns (uint256) {
        return maxLevels = _value;
    }

    function getDefaultReferrer() public view returns (address) {
        return defaultReferrer;
    }

    function setDefaultReferrer(address payable _address) public onlyOwner {
        defaultReferrer = _address;
    }

    function getTokenContract()
        external
        view
        returns (
            address tokenAddress,
            string memory tokenName,
            uint256 tokenDecimals,
            uint256 tokenSupply
        )
    {
        tokenAddress = tokenContract;
        tokenName = IERC20_EXTENDED(tokenContract).name();
        tokenDecimals = IERC20_EXTENDED(tokenContract).decimals();
        tokenSupply = IERC20Upgradeable(tokenContract).totalSupply();
    }

    function setTokenContractAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        tokenContract = _address;
        return true;
    }

    function getUSDContract()
        external
        view
        returns (
            address USDAddress,
            string memory USDName,
            uint256 USDDecimals,
            uint256 USDSupply
        )
    {
        USDAddress = USDContract;
        USDName = IERC20_EXTENDED(USDContract).name();
        USDDecimals = IERC20_EXTENDED(USDContract).decimals();
        USDSupply = IERC20Upgradeable(USDContract).totalSupply();
    }

    function setUSDContractAdmin(
        address _address
    ) external onlyOwner returns (bool) {
        USDContract = _address;
        return true;
    }

    function getPresaleContract() external view returns (address) {
        return presaleContract;
    }

    function setPresaleContract(
        address _address
    ) external onlyOwner returns (address) {
        return presaleContract = _address;
    }

    function getStakingContract() external view returns (address) {
        return stakingContract;
    }

    function setStakingContract(
        address _address
    ) external onlyOwner returns (address) {
        return stakingContract = _address;
    }

    function getUserReferrerAddress(
        address _address
    ) external view returns (address referrer) {
        Account storage userAccount = accounts[_address];
        referrer = userAccount.referrer;
    }

    function getUserReferee(
        address _address
    )
        external
        view
        returns (address[] memory userRefereeAddress, uint256 userRefereeCount)
    {
        Account storage userAccount = accounts[_address];
        userRefereeAddress = userAccount.referredAddresses;
        userRefereeCount = userRefereeAddress.length;
    }

    function getUserTeamReferee(
        address _address
    )
        external
        view
        returns (
            address[] memory userTeamReferees,
            uint256 userTeamRefereeCount
        )
    {
        Account storage userAccount = accounts[_address];
        userTeamReferees = userAccount.teamAddress;
        userTeamRefereeCount = userTeamReferees.length;
    }

    function getUserPendingRewards(
        address _address
    )
        external
        view
        returns (
            uint256 pendingRewardETH,
            uint256 pendingRewardUSD,
            uint256 pendingRewardStaking
        )
    {
        Account storage userAccount = accounts[_address];
        pendingRewardETH = userAccount.pendingRewardETH;
        pendingRewardUSD = userAccount.pendingRewardUSD;
        pendingRewardStaking = userAccount.pendingRewardStaking;
    }

    function getUserRewardPaid(
        address _address
    )
        external
        view
        returns (
            uint256[] memory rewardPaidETH,
            uint256[] memory rewardPaidUSD,
            uint256[] memory rewardPaidStaking
        )
    {
        Account storage userAccount = accounts[_address];
        rewardPaidETH = userAccount.rewardPaidETH;
        rewardPaidUSD = userAccount.rewardPaidUSD;
        rewardPaidStaking = userAccount.rewardPaidStaking;
    }

    function getUserRewardPaidTimestamp(
        address _address
    )
        external
        view
        returns (
            uint256[] memory rewardPaidTimeETH,
            uint256[] memory rewardPaidTimeUSD,
            uint256[] memory rewardPaidTimeStaking
        )
    {
        Account storage userAccount = accounts[_address];
        rewardPaidTimeETH = userAccount.rewardPaidTimeETH;
        rewardPaidTimeUSD = userAccount.rewardPaidTimeUSD;
        rewardPaidTimeStaking = userAccount.rewardPaidTimeStaking;
    }

    function getUserTotalRewardPaid(
        address _address
    )
        external
        view
        returns (
            uint256 rewardPaidETH,
            uint256 rewardPaidUSD,
            uint256 rewardPaidStaking
        )
    {
        Account storage userAccount = accounts[_address];
        uint256 ethLength = userAccount.rewardPaidETH.length;
        uint256 USDLength = userAccount.rewardPaidUSD.length;
        uint256 stakingLength = userAccount.rewardPaidStaking.length;

        for (uint256 i; i < ethLength; i++) {
            rewardPaidETH += userAccount.rewardPaidETH[i];
        }

        for (uint256 i; i < USDLength; i++) {
            rewardPaidUSD += userAccount.rewardPaidUSD[i];
        }

        for (uint256 i; i < stakingLength; i++) {
            rewardPaidStaking += userAccount.rewardPaidStaking[i];
        }
    }

    function getUserTotalBusiness(
        address _address
    ) external view returns (uint256 businessETH, uint256 businessUSD) {
        Account storage userAccount = accounts[_address];
        businessETH = userAccount.totalBusinessETH;
        businessUSD = userAccount.totalBusinessUSD;
    }

    function totalPendingRewards()
        external
        view
        returns (
            uint256 rewardsPendingETH,
            uint256 rewardsPendingUSD,
            uint256 rewardsPendingStaking
        )
    {
        rewardsPendingETH = pendingReferralETH;
        rewardsPendingUSD = pendingReferralUSD;
        rewardsPendingStaking = pendingReferralStaking;
    }

    function _hasReferrer(address _address) private view returns (bool) {
        return accounts[_address].referrer != address(0);
    }

    function hasReferrer(address _address) external view returns (bool) {
        return _hasReferrer(_address);
    }

    function _isCircularReference(
        address referrer,
        address referee
    ) private view returns (bool) {
        require(referrer != address(0), "Address cannot be 0x0.");
        address parent = referrer;

        for (uint256 i; i < maxLevels; i++) {
            if (parent == referee) {
                return true;
            }

            parent = accounts[parent].referrer;
        }

        return false;
    }

    function _addReferrer(
        address _address,
        address _referrer
    ) private returns (bool) {
        if (_isCircularReference(_referrer, _address)) {
            emit RegisterRefererFailed(
                _address,
                _referrer,
                "Referee cannot be one of referrer uplines."
            );
            return false;
        } else if (accounts[_address].referrer != address(0)) {
            emit RegisterRefererFailed(
                _address,
                _referrer,
                "Address already have referrer."
            );
            return false;
        }

        Account storage userAccount = accounts[_address];
        Account storage referrerAccount = accounts[_referrer];
        userAccount.referrer = payable(_referrer);
        referrerAccount.referredAddresses.push(_address);
        emit RegisteredReferer(_referrer, _address);

        for (uint256 i; i < levelRateStaking.length; i++) {
            Account storage referrerParentAddress = accounts[
                referrerAccount.referrer
            ];

            if (referrerAccount.referrer == address(0)) {
                break;
            }

            referrerParentAddress.teamAddress.push(_address);

            referrerAccount = referrerParentAddress;
            emit RegisteredTeamAddress(
                referrerAccount.referrer,
                _referrer,
                _address
            );
        }
        return true;
    }

    function addReferrerAdmin(
        address _userAddress,
        address _referrerAddress
    ) external returns (bool) {
        require(
            msg.sender == owner() ||
                msg.sender == presaleContract ||
                msg.sender == stakingContract,
            "Only owner can call this function."
        );
        return _addReferrer(_userAddress, _referrerAddress);
    }

    function _payReferralInETH(
        uint256 _value,
        address _userAddress,
        address _referrer
    ) private {
        if (!_hasReferrer(_userAddress) && _referrer != address(0)) {
            _addReferrer(_userAddress, _referrer);
        }

        if (!_hasReferrer(_referrer) && _referrer != address(0)) {
            _addReferrer(_referrer, defaultReferrer);
        }

        Account memory userAccount = accounts[_userAddress];
        uint256 totalReferral;

        for (uint256 i; i < levelRateReferral.length; i++) {
            address referrer = userAccount.referrer;

            Account storage referrerAccount = accounts[userAccount.referrer];

            if (referrer == address(0)) {
                break;
            }

            uint256 c = _value.mul(levelRateReferral[i]).div(levelDecimals);
            referrerAccount.totalBusinessETH += _value;
            referrerAccount.pendingRewardETH += c;
            totalReferral += c;

            emit ReferralIncomeGenerated(
                _userAddress,
                referrer,
                c,
                i + 1,
                "ETH"
            );

            userAccount = referrerAccount;
        }

        pendingReferralETH += totalReferral;
    }

    function payReferralETHAdmin(
        uint256 _value,
        address _userAddress,
        address _referrer
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() || _msgSender == presaleContract,
            "Only owner can call this function."
        );
        _payReferralInETH(_value, _userAddress, _referrer);
        return true;
    }

    function _payReferralInUSD(
        uint256 _value,
        address _userAddress,
        address _referrer
    ) private {
        if (!_hasReferrer(_userAddress) && _referrer != address(0)) {
            _addReferrer(_userAddress, _referrer);
        }

        if (!_hasReferrer(_referrer) && _referrer != address(0)) {
            _addReferrer(_referrer, defaultReferrer);
        }
        Account memory userAccount = accounts[_userAddress];
        uint256 totalReferral;

        for (uint256 i; i < levelRateReferral.length; i++) {
            address referrer = userAccount.referrer;
            Account storage referrerAccount = accounts[userAccount.referrer];

            if (referrer == address(0)) {
                break;
            }

            uint256 c = _value.mul(levelRateReferral[i]).div(levelDecimals);

            referrerAccount.totalBusinessUSD += _value;
            referrerAccount.pendingRewardUSD += c;
            totalReferral += c;

            emit ReferralIncomeGenerated(
                _userAddress,
                referrer,
                c,
                i + 1,
                "USD"
            );
            userAccount = referrerAccount;
        }

        pendingReferralUSD += totalReferral;
    }

    function payReferralUSDAdmin(
        uint256 _value,
        address _userAddress,
        address _referrer
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() || _msgSender == presaleContract,
            "Only owner can call this function."
        );
        _payReferralInUSD(_value, _userAddress, _referrer);
        return true;
    }

    function _payReferralStaking(uint256 value, address _referee) private {
        Account memory userAccount = accounts[_referee];
        uint256 totalReferral;

        for (uint256 i; i < levelRateStaking.length; i++) {
            address referrer = userAccount.referrer;
            Account storage referrerAccount = accounts[userAccount.referrer];

            if (referrer == address(0)) {
                break;
            }

            uint256 c = value.mul(levelRateStaking[i]).div(levelDecimals);

            referrerAccount.totalBusinessUSD += value;
            referrerAccount.rewardPaidUSD.push(c);
            totalReferral += c;

            emit StakingReferralIncomeGenerated(
                _referee,
                referrer,
                c,
                i + 1,
                "Staking Referral"
            );
            userAccount = referrerAccount;
        }

        pendingReferralStaking += totalReferral;
    }

    function payStakingReferralAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool) {
        address _msgSender = msg.sender;
        require(
            _msgSender == owner() || _msgSender == stakingContract,
            "Only owner can call this function."
        );
        _payReferralStaking(_value, _referee);
        return true;
    }

    function claimRewardETH() external {
        address _userAddress = msg.sender;
        Account storage userAccount = accounts[_userAddress];
        uint256 userPendingReward = userAccount.pendingRewardETH;
        payable(_userAddress).transfer(userPendingReward);

        userAccount.rewardPaidETH.push(userPendingReward);
        userAccount.rewardPaidTimeETH.push(block.timestamp);

        pendingReferralETH -= userPendingReward;
        emit ReferralRewardClaimed(_userAddress, userPendingReward, "ETH");

        userAccount.pendingRewardETH = 0;
    }

    function claimRewardUSD() external {
        address _userAddress = msg.sender;
        Account storage userAccount = accounts[_userAddress];
        uint256 userPendingReward = userAccount.pendingRewardUSD;
        IERC20Upgradeable(USDContract).transfer(
            _userAddress,
            userPendingReward
        );

        userAccount.rewardPaidUSD.push(userPendingReward);
        userAccount.rewardPaidTimeUSD.push(block.timestamp);

        pendingReferralUSD -= userPendingReward;
        emit ReferralRewardClaimed(_userAddress, userPendingReward, "USD");
        userAccount.pendingRewardUSD = 0;
    }

    function claimRewardStaking() external {
        address _userAddress = msg.sender;
        Account storage userAccount = accounts[_userAddress];
        uint256 userPendingReward = userAccount.pendingRewardStaking;
        IERC20Upgradeable(tokenContract).transfer(
            _userAddress,
            userPendingReward
        );

        userAccount.rewardPaidStaking.push(userPendingReward);
        userAccount.rewardPaidTimeStaking.push(block.timestamp);

        pendingReferralStaking -= userPendingReward;
        emit ReferralRewardClaimed(
            _userAddress,
            userPendingReward,
            IERC20_EXTENDED(tokenContract).name()
        );

        userAccount.pendingRewardStaking = 0;
    }

    function claimRewardAll() external {
        address _userAddress = msg.sender;
        Account storage userAccount = accounts[_userAddress];
        uint256 rewardETH = userAccount.pendingRewardETH;
        uint256 rewardUSD = userAccount.pendingRewardUSD;
        uint256 rewardStaking = userAccount.pendingRewardStaking;

        //ETH Reward Claim

        payable(_userAddress).transfer(rewardETH);

        userAccount.rewardPaidETH.push(rewardETH);
        userAccount.rewardPaidTimeETH.push(block.timestamp);

        pendingReferralETH -= rewardETH;
        emit ReferralRewardClaimed(_userAddress, rewardETH, "ETH");
        userAccount.pendingRewardETH = 0;

        //USD Reward Claim

        IERC20Upgradeable(USDContract).transfer(_userAddress, rewardUSD);

        userAccount.rewardPaidUSD.push(rewardUSD);
        userAccount.rewardPaidTimeUSD.push(block.timestamp);

        pendingReferralUSD -= rewardUSD;
        emit ReferralRewardClaimed(_userAddress, rewardUSD, "USD");
        userAccount.pendingRewardUSD = 0;

        //Staking Reward Claim

        IERC20Upgradeable(tokenContract).transfer(_userAddress, rewardStaking);

        userAccount.rewardPaidStaking.push(rewardStaking);
        userAccount.rewardPaidTimeStaking.push(block.timestamp);

        pendingReferralStaking -= rewardStaking;
        emit ReferralRewardClaimed(
            _userAddress,
            rewardStaking,
            IERC20_EXTENDED(tokenContract).name()
        );
        userAccount.pendingRewardStaking = 0;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function sendNativeFundsAdmin(
        address _address,
        uint256 _value
    ) external onlyOwner {
        payable(_address).transfer(_value);
    }

    function withdrawAdmin() external onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }

    function withdrawTokenAdmin(
        address _tokenAddress,
        uint256 _value
    ) external onlyOwner {
        IERC20Upgradeable(_tokenAddress).transfer(msg.sender, _value);
    }
}

